import './App.css'
import { data } from './Data'

function App() {
  return (
    <div className='App'>
      <h1>Kitap Sepeti</h1>
      {data.map((book) => (
        <div>
          <h1>{book.name}</h1>
          <p>{book.author}</p>
          <img src={book.image} alt={book.name} />
          <small>{book.price}</small>
        </div>
      ))}
    </div>
  )
}

export default App
